window.bookSummaryJSON = "<p><b>Some unexpected help with the single-planet problem</b></p> <p>Billionaire industrialist Ted Burke understands that humanity has always balanced on the edge of a knife. A single planetary cataclysm could wipe out the human race. As long as humanity only occupies one planet, the danger exists.</p> <p>Computer genius Bernd Decker understands it, too. Together, Burke and Decker come up with a daring plan to send human colonies out to multiple other planets. Not least among their problems is that no one yet has solved the problem of interstellar travel.</p> <p>Bernd Decker's computer project offers to help. But Decker doesn't realize that the Joint Artificial Neural Intelligence Computation Engine - JANICE - has crossed the Singularity.</p>"; 
